import React from "react";
import ReactDOM from "react-dom";
// import PageFooter from "../components/Footer"
import Login from "./pages/Login"
import Dashboard from "./pages/Dashboard"
import {
  Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Switch>
            <Route path="/">
              <Login />
            </Route>
            <Route path="/:username">
              <Dashboard />
            </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
